Марка - Роман
Год выпуска - 1990
Страна производитель - совместный эксперимент России и Украины;
Пробег - 26 лет
Цвет - русый (родной)
Высота - 181 см
Масса - 77,7 (без нагрузки)
Фары - зеленый ксенон
Привод - классический
Кузов - не битый, не ржавый, не гнилой. Антикор, полировка.
Крыша- на месте,без присмотра подвержена деформации; 
Тип топлива - все, что горит.
Многоточечная система впрыска.
Расход топлива- максимальный; 
Тормоза с ABS (ручник отсутствует)
Резина- шипованая;
На крутых поворотах иногда заносит; 
Руль- легкий,но при аккуратном обращении;
Может отказывать в управлении;
Салон- кожанный, светлый, местами пушистый; 
Музыка (стерео) с двумя динамиками по центру вверху (включается самопроизвольно и без предупреждения).
Эксплуатация бережная. По ночам гаражное хранение в теплом боксе с предварительной мойкой.
Состояние идеальное. 
Заводится с пол-оборота, даже утром и в мороз.
Количество предыдущих владельцев не установлено; 
 Готов к долгому пробегу.
 Вложений не требует, кроме установки противоугонной системы.
Документы на руках.
Тест-драйв в будни с 19 до 23, по выходным в любое время
